import { useState, useEffect } from 'react';
import axios from 'axios';

export default function Search({ handleSearch }) {
  const [pokemonResults, setPokemonResults] = useState([]);
  const [name, setName] = useState('');
  const [primaryType, setPrimaryType] = useState('');
  const [secondaryType, setSecondaryType] = useState('');
  const [generation, setGeneration] = useState('');
  const [currentPage, setCurrentPage] = useState(1);
  const [itemsPerPage] = useState(10);

  const types = ["All", "Normal", "Fire", "Water", "Electric", "Grass", "Ice", "Fighting", "Poison", "Ground", "Flying", "Psychic", "Bug", "Rock", "Ghost", "Dragon", "Dark", "Steel"];

  const generations = ["All", "I", "II", "III", "IV", "V", "VI", "VII", "VIII", "IX"];

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await axios.get('https://pokeapi.co/api/v2/pokemon?limit=100000');
        const pokemonResults = response.data.results;
        setPokemonResults(pokemonResults);
      } catch (error) {
        console.log('Error:', error.message);
      }
    };

    fetchData();
  }, []);

  useEffect(() => {
    const handleName = () => {
      handleSearch(name);
    };

    handleName();
  }, [name, handleSearch]);

  const handlePrimaryType = (e) => {
    setPrimaryType(e.target.value);
  };

  const handleSecondaryType = (e) => {
    setSecondaryType(e.target.value);
  };

  const handleGeneration = (e) => {
    setGeneration(e.target.value);
  };

  const indexOfLastItem = currentPage * itemsPerPage;
  const indexOfFirstItem = indexOfLastItem - itemsPerPage;
  const currentPokemon = pokemonResults.slice(indexOfFirstItem, indexOfLastItem);
  const totalPages = Math.ceil(pokemonResults.length / itemsPerPage);

  const paginate = (pageNumber) => {
    setCurrentPage(pageNumber);
  };

  return (
    <div>
      <div>
        <div>
          <input value={name} onChange={(e) => setName(e.target.value)}></input>
        </div>
        <div>
          <h3>Primary Type: </h3>
          <select value={primaryType} onChange={handlePrimaryType}>
            {types.map((type) => (
              <option key={type} value={type}>
                {type}
              </option>
            ))}
          </select>
        </div>
        <div>
          <h3>Secondary Type: </h3>
          <select value={secondaryType} onChange={handleSecondaryType}>
            {types.map((type) => (
              <option key={type} value={type}>
                {type}
              </option>
            ))}
          </select>
        </div>
        <div>
          <h3>Generation: </h3>
          <select value={generation} onChange={handleGeneration}>
            {generations.map((gen) => (
              <option key={gen}>{gen}</option>
            ))}
          </select>
        </div>
      </div>
      <div>
        {currentPokemon.map((pokemon, index) => (
          <div key={index}>
            <img src={`https://pokeapi.co/media/sprites/pokemon/${pokemon.url.split('/')[6]}.png`} alt={pokemon.name} />
            <p>{pokemon.name}</p>
          </div>
        ))}
      </div>
      <div>
        <button onClick={() => paginate(currentPage - 1)} disabled={currentPage === 1}>Previous</button>
        <button onClick={() => paginate(currentPage + 1)} disabled={currentPage === totalPages}>Next</button>
      </div>
    </div>
  );
}
